export default class DataProvider {
    getData() {
        return fetch(`./data.json`)
            .then(response => {
                if (!response.ok) {
                    throw new Error(`Response error: ${response.status}`);
                }
                console.log(response)
                return response;
            })
            .then(data => data.map(it => ({ ...it, date: new Date(it.date) })));
    }
}
